    "Honduras - Transport and Farm to Market",nt"tracking_summary": {ntt"total":
    16,ntt"recent": 2nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-12-08T21:04:30.084496",nt"name": "honduras-transport-and-farm-to-market",nt"isopen":
    false,nt"url": null,nt"notes": " n        The evaluation of the Transport
    Project and Farm to Market Roads Activity aimed to answer whether or not improved
    conditions throughout the road network:nu2022 Lowered transport costs and travel
    time for businesses, including farm households; nu2022 Provided better access to
    a wider range of job opportunities for individuals (labor market effects);nu2022
    Lowered the price of consumables and inputs by increasing competition and reducing
    barriers to entry posed by poor transport infrastructure; andnu2022 Improved access
    to health establishments and schoolsnnThe overall expected result of these changes
    was an increase in overall incomes and employment at the household level. To comprehensively
    evaluate the impact of the MCA Honduras Transportation project, the Independent
    Evaluator used two methods: (i) a model-based approach, in which the treatment effect
    is represented by change in travel time, and the program impact is represented as
    a function of change in travel time. The model relies heavily on Geographic Information
    Systems (GIS) data for several purposes, including the estimation of changes in
    travel time; and (ii) HDM-IV analysis.n      ",nt"license_title": "License
